import React from 'react';
import './App.css';
import NavigationBar from './components/navigationBar';
import Hero from './components/hero';
import Education from './components/education';



function App() {

  return (
    <div className="App">

      <header className='App-header'>
        <NavigationBar />
      </header>

      <main>
        <Hero /> 

        <p> My Education</p>
        <Education />

        <p> My Projects</p>

        <p> My Skills</p>

      </main>



    </div>
  );
}

export default App;
